import React, { Component } from 'react';

// url(' + ./images/prism/prism.png + ')`
const AppContainerStyles = {
  backgroundImage: `url(images/prism/prism.png)`,
  backgroundSize: 'cover',
  overflow: 'hidden'
}

class App extends Component {
  render() {
    return (
      <div className="app_container" style={AppContainerStyles}>
        <h1>Tricky Clicks!</h1>
      </div>
    );
  }
}

export default App;
